import React, { useState } from "react";
import { useNavigate } from "react-router-dom"; // For navigation
import "./Sign.css";

const Sign = ({ onBackClick }) => {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [errorMessage, setErrorMessage] = useState("");
  const [isSubmitting, setIsSubmitting] = useState(false);
  const navigate = useNavigate();

  const handleBackClick = () => {
    if (onBackClick) {
      onBackClick();
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate input fields
    if (!username || !email || !password || !confirmPassword) {
      setErrorMessage("All fields are required.");
      return;
    }

    if (password !== confirmPassword) {
      setErrorMessage("Passwords do not match.");
      return;
    }

    setIsSubmitting(true); // Start loading state

    try {
      const response = await fetch("http://localhost:5000/signup", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ username, email, password, confirmPassword }),
      });

      const data = await response.json();

      if (response.ok) {
        alert("User registered successfully!");
        navigate("/login"); // Redirect to login page
      } else {
        setErrorMessage(data.message || "Something went wrong.");
      }
    } catch (error) {
      setErrorMessage("Server error, please try again later.");
    } finally {
      setIsSubmitting(false); // End loading state
    }
  };

  return (
    <div className="login-page">
      <button className="back-button" onClick={handleBackClick}>
        <img src="arrow_back.png" alt="Back" />
      </button>
      <div className="orange-triangle">
        <img src="taco.png" alt="Orange Triangle" className="taco" />
      </div>
      <div className="pink-ellipse">
        <img src="pinkelip.png" alt="Pink Ellipse" className="pink" />
      </div>
      <div className="login-container">
        <form onSubmit={handleSubmit}>
          <label>Username</label>
          <input
            type="text"
            placeholder="Enter your username"
            value={username}
            onChange={(e) => {
              setUsername(e.target.value);
              setErrorMessage("");
            }}
          />

          <label>Email</label>
          <input
            type="email"
            placeholder="Enter your email"
            value={email}
            onChange={(e) => {
              setEmail(e.target.value);
              setErrorMessage("");
            }}
          />

          <label>Password</label>
          <input
            type="password"
            placeholder="Enter your password"
            value={password}
            onChange={(e) => {
              setPassword(e.target.value);
              setErrorMessage("");
            }}
          />

          <label>Confirm Password</label>
          <input
            type="password"
            placeholder="Re-enter your password"
            value={confirmPassword}
            onChange={(e) => {
              setConfirmPassword(e.target.value);
              setErrorMessage("");
            }}
          />
          {errorMessage && <div className="message">{errorMessage}</div>}

          <button type="submit" className="btn login-btn" disabled={isSubmitting}>
            {isSubmitting ? "Signing Up..." : "Sign Up"}
          </button>

          <div className="or">OR</div>

          <button type="button" className="btn google-btn">
            <img src="google.png" alt="Google Icon" />
            Sign Up with Google
          </button>
        </form>

        <div className="register">
          Already have an account?{" "}
          <button
            onClick={() => navigate("/login")}
            className="register-btn"
          >
            Login
          </button>
        </div>
      </div>

      <div className="bottom-circle">
        <img src="bottomellip.png" alt="Bottom Circle" className="bottom" />
      </div>
    </div>
  );
};

export default Sign;
